import React from 'react'
import { Link } from 'react-router-dom';
const Postitems = (props) => {
    return (    
        <div className="news-post article-post2">
            <div className="row">
                <div className="col-md-6">
                    <div className="image-holder">
                        <img src="upload/blog/f1.jpg" alt="" />
                    </div>
                </div>
                <div className="col-md-6">
                    <Link className="text-link" to="#">props.posts.ategory</Link>
                    <h2><Link to="single-post.html">Nullam malesuada eratut turpis.</Link></h2>
                    <ul className="post-tags">
                        <li>3 days ago</li>
                        <li><Link to="#">3 comments</Link></li>
                        <li>by <Link to="#">John Smith</Link></li>
                    </ul>
                    <p>Praesent dapibus, neque id cursus faucibus, tortor neque egestas auguae, eu vulputate magna eros eu erat. Aliquam erat volutpat. Nam dui mi, tincidunt ...</p>
                </div>
            </div>
        </div>
    );
};



export default Postitems;
